import React, { useState } from "react";
import { Button, Modal, Carousel } from "antd";

const ProjectModal = ({ open, onClose, count }) => {
  const imageSrc = {
    meta: [
      {
        src: "/images/meta/meta-1.png",
      },
      {
        src: "/images/meta/meta-2.png",
      },
      {
        src: "/images/meta/meta-3.png",
      },
      {
        src: "/images/meta/meta-4.png",
      },
      {
        src: "/images/meta/meta-5.png",
      },
      {
        src: "/images/meta/meta-6.png",
      },
      {
        src: "/images/meta/meta-7.png",
      },
      {
        src: "/images/meta/meta-8.png",
      },
      {
        src: "/images/meta/meta-9.png",
      },
    ],
  };

  return (
    <Modal title="Modal 1000px width" centered open={open} onCancel={onClose}>
      <Carousel autoplay>
        {imageSrc.meta.map((i) => {
          return (
            <div>
              <img src={`/images/meta/meta-${i.meta.src}.png`} alt="meta" />
            </div>
          );
        })}
      </Carousel>
    </Modal>
  );
};

export default ProjectModal;
